import { TableFooter } from '@material-ui/core';
import React, { useState, useEffect } from 'react';
import { useLocation } from "react-router-dom";
import SearchResultsCard from '../components/SearchResultsCard';
import SearchResultsNav from '../components/Navbars/SearchResultsNav';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';





function SearchResultsContainer() {



    const data = useLocation();
    console.log(data.state)
    // console.log(props.state.project)
    // const project = props.state.project
console.log(data.state.accurateResults.map(project => project.language))




    return (



        <div>
            <SearchResultsNav user={data.state.user} project={data.state.accurateResults.map(project => project[0].language)}/>
<Container>
            <Grid
                container
                direction="row"
                justify="space-evenly"
                alignItems="center"
                >
            {data.state.accurateResults.map(project => <SearchResultsCard project={project} key={project.id} user={data.state.user} />)}

            </Grid>
            </Container>
        </div> 
    )








};

export default SearchResultsContainer;
